    [],nt"num_tags": 0,nt"name": "mosaic-of-gridded-multibeam-bathymetry-gridded-lidar-bathymetry-and-bathymetry-derived-from-mul",nt"isopen":
    false,nt"url": null,nt"notes": "Gridded multibeam bathymetry is integrated
    with gridded LiDAR bathymetry and bathymetry derived from multispectral IKONOS satellite
    data. Gridded (5 m cell size) multibeam bathymetry collected aboard NOAA Ship Hiialaka'i
    and R/V AHI. LiDAR/multibeam bathymetry mosiac provided by the U.S. Navy through
    PIBHMC. Bathymetry values shallower than 25 m were derived by gauging the relative
    attenuation of blue and green spectral radiance as a function of depth (as gauged
    by LiDAR data). A multiple linear regression analysis of linearized blue and green
    band spectral values against depth determined the variables of y-intercept, blue
    slope and green slope values. Variables then used in multivariate slope intercept
    formula to derive depth. Variables were adjusted to improve the statistical accuracy
    and spatial coverage of the final derived bathymetry product. Digital image processing
    to derive depths conducted with the ENVI 4.5 software program while data editing
    and integration was performed using ArcGIS 9.3. This dataset is for the shelf environment
    of Tinian Island, Commonwealth of the Northern Marianas Islands, USA.",nt"owner_org":
